import ExpenseItem from "./ExpenseItem";

export default function ExpensesList(props) {
  return (
    <>
      {props.expenses.length === 0 && <p>No expenses found</p>}
      {props.expenses.length > 0 &&
        props.filtered.map((expense) => (
          <ExpenseItem
            key={expense.id}
            title={expense.title}
            amount={expense.amount}
            date={expense.date}
          />
        ))}
    </>
  );
}
